  KEY `file_detail_area_index` (`area`) USING BTREE,
  KEY `file_detail_car_sys_index` (`car_sys`) USING BTREE,
  KEY `file_detail_status_index` (`status`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

